"use strict";
// string
let myString = "Hello, TypeScript!";
console.log(myString); // Hello, TypeScript!
// number
let myNumber = 42;
console.log(myNumber); // 42
// boolean
let myBoolean = true;
console.log(myBoolean); // true
// null 
let myNull = null;
console.log(myNull); // null
// any 
let myAny = "I can be anything!";
console.log(myAny);
myAny = "123";
console.log(myAny);
myAny = false;
console.log(myAny);
// any 배열
let anyList = [123, "가나다", true];
console.log(anyList);
